//   const [opened, { open, close }] = useState(false);

  return (
    <>
      <Modal opened={ModelOpene} onClose={()=>setModelOpen(false)} title="Your Info">
        {/* Modal content */}

      <form action="" className='InfoForm'>
        <h3>Your Info</h3>
        <div><input type="text" name="FirstName" id="" placeholder='FirstName'/></div>
      </form>
      </Modal>
      {/* <Button onClick={open}>Open modal</Button> */}
    </>
  );
}
